import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Sales() {

  const [mydata,setdata] = useState([]);

  useEffect(()=>{
   axios
   .get('http://127.0.0.1:8000/project/sales/')
   .then((res)=> setdata(res.data));
  }, [])

  return (
    <>
      <h1>Sales Data</h1>
      
      {mydata.map((sales)=>{
        const {customer_id} = sales;
         <h2>{sales.customer_id}</h2>
      })}

      
    </>
  );
};



export default Sales;
